//Component containing all entry objects as queried from central database. Move to dev.

const EntryList = (props) => {
    const entries = props.entries;

    //eventually we will define both the database ENTRIES and the HANDLEDELETE within this method, which will handle te ENTRYLIST for backend interaction with the server!

    return ( 
        <div className="search-result">
        { entries.map((entry) => (
            <div className="blog-preview" key={entry.id}>
                <h2>{entry.title}</h2>
                <p>writtenby {entry.author}</p>
                <p>id: {entry.id}</p>
                <button onClick={() => handleDelete(entry.id)}>delete entry</button>
            </div>
        ))}   
            
        </div>
     );
}
 
export default EntryList;
